import logo from './logo.svg';
import './App.css';

import SplitText from "./SplitText";

const handleAnimationComplete = () => {
  console.log('All letters have animated!');
};

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <SplitText
          text="CIAO, come stai?"
          className="text-3xl font-bold mb-4"
          splitType="chars"
          from={{ opacity: 0, y: 40 }}
          to={{ opacity: 1, y: 0 }}
          delay={100}
          duration={0.6}
          ease="power3.out"
          textAlign="center"
        />
        <SplitText
          text="Alessandro Zingaretti"
          className="text-xl font-semibold"
          splitType="chars"
          from={{ opacity: 0, y: 40 }}
          to={{ opacity: 1, y: 0 }}
          delay={100}
          duration={0.6}
          ease="power3.out"
          textAlign="center"
        />
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
